import { TransactionUnspentOutput, Address, Value } from "@emurgo/cardano-serialization-lib-browser/cardano_serialization_lib";
import { Buffer } from "buffer";

const ERROR_CLIENT_ONLY = new Error("Wallets not supported on server");
const ERROR_NOT_AVAILABLE = new Error("Wallet not available");

export const useNetwork = (net = "mainnet") => {
	const PARAM_URLS = {
		mainnet: "https://d1t0d7c2nekuk0.cloudfront.net/mainnet.json",
		preprod: "https://d1t0d7c2nekuk0.cloudfront.net/preprod.json",
		preview: "https://d1t0d7c2nekuk0.cloudfront.net/preview.json",
	};

	const networkParams = ref(undefined);
	const isReady = ref(false);
	const isLoading = ref(false);
	const error = ref(undefined);

	const init = async () => {
		isLoading.value = true;
		try {
			networkParams.value = await $fetch(PARAM_URLS[net]);
			isReady.value = true;
		} catch (e) {
			error.value = e;
		} finally {
			isLoading.value = false;
		}
	};

	init();

	return {
		networkParams,

		isReady,
		isLoading,
		error,
	};
};

export const useWallets = () => {
	const isReady = ref(false);
	const isLoading = ref(false);
	const error = ref(undefined);
	const SUPPORTED_WALLETS = [
		{
			name: "Nami",
			provider: "nami",
			urls: {
				google: "https://chrome.google.com/webstore/detail/nami/lpfcbjknijpeeillifnkikgncikgfhdo",
			},
			icon: `data:image/svg+xml;base64,`,
		},
		{
			name: "Eternl",
			provider: "eternl",
			urls: {
				google: "https://chrome.google.com/webstore/detail/eternlcc/kmhcihpebfmpgmihbkipmjlmmioameka",
			},
			icon: `data:image/png;base64,`,
		},
		{
			name: "Flint",
			provider: "flint",
			urls: {
				google: "https://chrome.google.com/webstore/detail/flint-wallet/hnhobjmcibchnmglfbldbfabcgaknlkj",
			},
			icon: `data:image/svg+xml;base64,`,
		},
		{
			name: "Gero",
			provider: "gerowallet",
			urls: {
				google: "https://chrome.google.com/webstore/detail/gerowallet/bgpipimickeadkjlklgciifhnalhdjhe",
			},
			icon: `data:image/svg+xml;base64,`,
		},
		{
			name: "Typhon",
			provider: "typhoncip30",
			urls: {
				google: "https://chrome.google.com/webstore/detail/typhon-wallet/kfdniefadaanbjodldohaedphafoffoh",
			},
			icon: `data:image/svg+xml;base64,`,
		},
		{
			name: "Yoroi",
			provider: "yoroi",
			urls: {
				google: "https://chrome.google.com/webstore/detail/yoroi/ffnbelfdoeiohenkjibnmadjiehjhajb",
			},
			icon: `data:image/png;base64,`,
		},
	];

	const init = async () => {
		error.value = undefined;
		isReady.value = false;
		isLoading.value = true;

		if (process.client) {
			// Wallets only supported on client
			for (const supportedWallet of SUPPORTED_WALLETS) {
				// Is the wallet installed?
				supportedWallet.installed = window?.cardano?.hasOwnProperty(supportedWallet.provider);
			}
		} else {
			error.value = ERROR_CLIENT_ONLY;
		}

		isReady.value = true;
		isLoading.value = false;
	};

	init();

	return {
		SUPPORTED_WALLETS,
		isReady,
		isLoading,
		error,
	};
};

export const useWallet = (default_provider_key = "walletprovider", default_handle_key = "adahandle") =>
	useState("wallet", () => {
		// State
		const isReady = ref(false);
		const isLoading = ref(false);
		const error = ref(undefined);

		// Wallet State
		const wallet = ref(null);
		const api = ref(null);
		const network_id = ref(null);
		const testnet = ref("testnet");
		const balance = ref(null);
		const address = ref(null);
		const changeAddress = ref(null);
		const ada_handles = ref([]);

		// Computed
		const isConnected = computed(() => api.value !== null);
		const network = computed(() => {
			if (network_id.value === null) return null;
			if (network_id.value === 1) return "mainnet";

			return testnet.value;
		});

		const currency_symbol = computed(() => {
			if (network_id.value === null) return "";
			return network_id.value === 1 ? "₳" : "t₳";
		});

		const { SUPPORTED_WALLETS } = useWallets();

		// Helpers
		const bech32FromHex = (address) => {
			return Address.from_bytes(Buffer.from(address, "hex")).to_bech32();
		};

		const reset_state = () => {
			error.value = undefined;

			wallet.value = null;
			api.value = null;
			network_id.value = null;
			testnet.value = "testnet";
			balance.value = null;
			address.value = null;
			changeAddress.value = null;
			ada_handles.value = [];
		};

		// Wallet API
		const connect = async (provider) => {
			console.log("Connecting to wallet", provider);
			disconnect();

			wallet.value = SUPPORTED_WALLETS.filter((wallet) => wallet.provider === provider)[0];

			if (wallet.value?.installed && window.parent.cardano[wallet.value?.provider]) {
				try {
					api.value = await window.parent.cardano[wallet.value?.provider].enable();
					// getNetworkId,
					// getBalance,
					// getUtxos,
					// getUsedAddresses,
					// getUnusedAddresses,
					// getRewardAddresses,
					// getChangeAddress,
					// signData,
					// signTx,
					// submitTx,

					localStorage.setItem(default_provider_key, provider);

					// Don't wait for these
					fetchBalance();
					fetchADAHandles();
					fetchNetwork();
					fetchChangeAddress();

					// await Promise.all([fetchNetwork(), fetchChangeAddress()]);
				} catch (e) {
					disconnect();
					// TODO: Error: no account set
					error.value = ERROR_NOT_AVAILABLE;
				}
			} else {
				error.value = ERROR_NOT_AVAILABLE;
			}
		};

		const disconnect = async () => {
			reset_state();
			localStorage.removeItem(default_provider_key);
		};

		const toggle = async (provider) => {
			isConnected.value && provider === wallet.value?.provider ? disconnect() : connect(provider);
		};

		// Only way I can figure out how to get which testnet we're on is by grabbing a random utxo and
		// calling the API (blockfrost) to see if the txid exists on each of the networks
		const fetchNetwork = async () => {
			if (network_id.value) return network.value;

			network_id.value = await api.value?.getNetworkId();

			if (network_id.value === 0) {
				testnet.value = "testnet"; // default (empty wallet?)

				// TODO: pick a random utxo and check the network
				const refUtxos = await api.value?.getUtxos(null, { page: 0, limit: 1 });
				if (refUtxos?.length) {
					const refUtxo = refUtxos[0];
					const utxo = TransactionUnspentOutput.from_bytes(Buffer.from(refUtxo, "hex"));
					const input = utxo.input();
					const txid = Buffer.from(input.transaction_id().to_bytes(), "utf8").toString("hex");

					const txOnNetwork = await $fetch(`/api/network/sniff/${txid}`);
					testnet.value = txOnNetwork?.network || "testnet";
				}
			}

			return network.value;
		};

		const fetchBalance = async () => {
			const cborBalance = await api.value?.getBalance();
			const decodeBalance = Value.from_bytes(Buffer.from(cborBalance, "hex"));
			balance.value = decodeBalance.coin().to_str() / 1000000; // convert from lovelace to ada
		};

		const fetchChangeAddress = async () => {
			const cborAdress = await api.value?.getChangeAddress();
			changeAddress.value = bech32FromHex(cborAdress);
			return changeAddress.value;
		};

		// TODO: leaning on helios for this for now, but I think I can just get the utxos myself and sort them smallest to largest
		// Actually more complicated than that but for sure can do it without the dependency
		// const pickUtxos = async (amount) => {
		// 	return await heliosWalletHelper.pickUtxos(amount);
		// };

		const fetchFirstUsedAddress = async () => {
			const cborAdress = (await api.value?.getUsedAddresses())[0];
			address.value = bech32FromHex(cborAdress);
		};

		const parseUTXO = async (rawUtxo) => {
			try {
				const utxo = TransactionUnspentOutput.from_bytes(Buffer.from(rawUtxo, "hex"));

				const input = utxo.input();
				const txid = Buffer.from(input.transaction_id().to_bytes(), "utf8").toString("hex");
				const txindx = input.index().toString(16);
				const output = utxo.output();
				const amount = output.amount().coin().to_str(); // ADA amount in lovelace
				const multiasset = output.amount().multiasset();
				let assetmap = [];

				if (multiasset) {
					const keys = multiasset.keys(); // policy Ids of thee multiasset
					const N = keys.len();

					for (let i = 0; i < N; i++) {
						const policyId = keys.get(i);
						const policyIdHex = Buffer.from(policyId.to_bytes(), "utf8").toString("hex");
						const assets = multiasset.get(policyId);
						const assetNames = assets.keys();
						const K = assetNames.len();

						for (let j = 0; j < K; j++) {
							const assetName = assetNames.get(j);
							const assetNameString = Buffer.from(assetName.name(), "utf8").toString();
							const assetNameHex = Buffer.from(assetName.name(), "utf8").toString("hex");
							const multiassetAmt = multiasset.get_asset(policyId, assetName);
							assetmap.push({
								policyId,
								policyIdHex,
								assetName,
								assetNameString,
								assetNameHex,
								amount: multiassetAmt,
							});
						}
					}
				}

				const obj = {
					txid: txid,
					txindx: txindx,
					amount: amount,
					str: `${txid} # ${txindx} = ${amount}`,
					assets: assetmap,
					TransactionUnspentOutput: utxo,
				};

				return obj;
			} catch (e) {
				console.log(e);
			}
		};

		// TODO: May want to cache this and refresh every X minutes
		const fetchUTXOs = async () => {
			const utxos = [];
			try {
				const rawUtxos = (await api.value?.getUtxos()).filter((utxo) => utxo);

				for (const rawUtxo of rawUtxos) {
					const utxo = await parseUTXO(rawUtxo);
					utxos.push(utxo);
				}
			} catch (e) {
				console.log(e);
			}

			return utxos;
		};

		const fetchADAHandles = async () => {
			let default_handle = localStorage.getItem(default_handle_key);

			ada_handles.value = [];
			const utxos = await fetchUTXOs();
			const POLICY_ADA_HANDLE = useRuntimeConfig().public.POLICY_ADA_HANDLE;

			utxos
				.filter(({ assets }) => assets.length > 0)
				.forEach(({ assets }) => {
					assets.forEach(({ policyIdHex, assetNameString }) => {
						if (policyIdHex === POLICY_ADA_HANDLE) {
							ada_handles.value.push({ handle: assetNameString, default: false });
						}
					});
				});

			setDefaultHandle(default_handle ? default_handle : ada_handles.value[0]?.handle);
		};

		const setDefaultHandle = (handle) => {
			ada_handles.value.forEach((ada_handle) => {
				ada_handle.default = ada_handle.handle === handle;
			});
			localStorage.setItem(default_handle_key, handle);
		};

		const ada_handle = computed(() => {
			return ada_handles.value.find((handle) => handle.default)?.handle;
		});

		const init = async () => {
			error.value = undefined;
			isReady.value = false;
			isLoading.value = true;

			if (process.client) {
				// Check localStorage for a wallet provider (reconnect)
				let default_provider = localStorage.getItem(default_provider_key);

				// We have a provider, try to connect
				if (default_provider) {
					await connect(default_provider);
				}

				isReady.value = true;
			} else {
				error.value = ERROR_CLIENT_ONLY;
			}

			isLoading.value = false;
		};

		init();

		return {
			wallet: readonly(wallet),
			api: readonly(api),
			network_id: readonly(network_id),
			network: readonly(network),
			currency_symbol: readonly(currency_symbol),
			balance: readonly(balance),
			address: readonly(address),
			changeAddress: readonly(changeAddress),
			ada_handles: readonly(ada_handles),
			ada_handle: readonly(ada_handle),

			fetchUTXOs,
			fetchChangeAddress,
			//pickUtxos,
			fetchNetwork,
			reset: reset_state,

			isReady: readonly(isReady),
			isLoading: readonly(isLoading),
			isConnected: readonly(isConnected),
			error: readonly(error),

			connect,
			disconnect,
			toggle,
			setDefaultHandle,
		};
	});
